import React, { useState } from "react";
import "./page.css";

export const Mypage = () => {
  const [isHovering, setIsHovering] = useState(0);

  return (
    <div>
      <ul className="mypage">
        <li
          onMouseOver={() => setIsHovering(1)}
          onMouseOut={() => setIsHovering(0)}
        >
          <a href="0">메인메뉴1</a>
          {isHovering ? (
            <ul className="submenu">
              <li>
                <a href="1">서브메뉴1</a>
              </li>
              <li>
                <a href="2">서브메뉴2</a>
              </li>
            </ul>
          ) : (
            ""
          )}
        </li>
      </ul>
    </div>
  );
};
